m'=>'Элемент списка','block titleComments'=>'Комментарии','block titleComments Previous Page'=>'Предыдущая страница комментариев','block titleComments Page Numbers'=>'Номера страниц комментариев','block titleComments Next Page'=>'Следующая страница комментариев','block titleCategories List'=>'Список рубрик','Single item: %s'=>'Отдельно: %s','Default template'=>'Шаблон по умолчанию','%s comment'=>'%s комментарий' . "\0" . '%s комментария' . "\0" . '%s комментариев','Create a site or only a username:'=>'Создать сайт или только имя пользователя:','Site Domain (subdomain only):'=>'Домен сайта (только поддомен):','Site Name (subdirectory only):'=>'Название сайта (только подпапка):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'Кажется, файл %s отсутствует. Он необходим для продолжения установки.','The date and time the preferences were updated.'=>'Дата и время обновления настроек.','Whether the theme disables generated layout styles.'=>'Отключает ли тема генерированные стили макета.','Whether a theme uses block-based template parts.'=>'Есть ли в теме части шаблонов на основе блоков.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store должен быть экземпляром WP_Style_Engine_CSS_Rules_Store','Revisions not enabled.'=>'Редакции отключены.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'Префикс для создаваемого шаблона. Используется для извлечения типа основного шаблона. Например, в случае «таксономия-книги» это будет «таксономия»','Indicates if a template is custom or part of the template hierarchy'=>'Указывает, является ли шаблон пользовательским или частью иерархии шаблонов','The slug of the template to get the fallback for'=>'Ярлык шаблона, для которого нужно получить запасной вариант','The icon for the post type.'=>'Значок для типа записи.','If the value is a string, the value will be used as the arc