ass %s if not using multisite.'=>'Нельзя указать %s, если не используется режим сети сайтов.','Webfont font weight must be a properly formatted string or integer.'=>'Толщина веб-шрифта должна быть корректно форматированной строкой или целым числом.','Each webfont src must be a non-empty string.'=>'Атрибут src каждого веб-шрифта должен быть непустой строкой.','Webfont src must be a non-empty string or an array of strings.'=>'Атрибут src веб-шрифта должен быть непустой строкой или массивом строк.','Webfont font family must be a non-empty string.'=>'Семейство веб-шрифтов должно быть непустой строкой.','Limit results to those matching a pattern (slug).'=>'Ограничить выборку результатами, которые совпадают с паттерном (ярлыком).','Ancestor blocks.'=>'Родительские блоки.','Determines whether the pattern is visible in inserter.'=>'Определяет, виден ли паттерн в инструменте вставки.','The pattern keywords.'=>'Ключевые слова паттерна.','The pattern category slugs.'=>'Ярлыки категории паттернов.','Block types that the pattern is intended to be used with.'=>'Типы блоков, с которыми предполагается использовать паттерн.','The pattern viewport width for inserter preview.'=>'Ширина окна просмотра паттерна для предварительного просмотра в инструменте вставки.','The pattern detailed description.'=>'Подробное описание паттерна.','The pattern name.'=>'Имя паттерна.','Sorry, you are not allowed to view the registered block patterns.'=>'Вам не разрешено просматривать зарегистрированные паттерны блоков.','The category label, in human readable format.'=>'Ярлык рубрики, в удобочитаемом формате.','The category name.'=>'Имя рубрики.','Sorry, you are not allowed to view the registered block pattern categories.'=>'Вам не разрешено просматривать зарегистрированные рубрики паттернов блоков.','Error in deleting the attachment.'=>'Ошибка удаления вложения.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>Ошибка</strong>: это недопустимый шаблон ленты.','unit symbolPB'=>'Пб'