nts Form'=>'Форма комментариев','block descriptionShow a block pattern.'=>'Показать паттерн блоков.','block titlePattern'=>'Паттерн','block descriptionA collection of blocks that allow visitors to get around your site.'=>'Набор блоков, которые позволяют посетителям перемещаться по вашему сайту.','block titleNavigation'=>'Навигация','block descriptionAdd a submenu to your navigation.'=>'Добавление подменю в навигацию по сайту.','block titleSubmenu'=>'Подменю','block descriptionAdd a page, link, or another item to your navigation.'=>'Добавляет страницу, ссылку или другой элемент в навигацию.','block titleCustom Link'=>'Произвольная ссылка','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'Отображение содержимого в нескольких столбцах с добавлением блоков в каждый столбец.','Preload valueNone'=>'Нет','No comments'=>'Без комментариев','Media item link optionNone'=>'Нет','Could not strip invalid text.'=>'Не удалось удалить неверный текст.','Could not retrieve table charset.'=>'Не удалось получить кодировку таблицы.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'Ошибка базы данных WordPress: Обработка значений для следующих полей не удалась: %s. Значения полей могут иметь избыточную длину или содержать неверные данные.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'Ошибка базы данных WordPress: Обработка значения для следующего поля не удалась: %s. Значение может иметь избыточную длину или содержать неверные данные.','WordPress database error: Could not perform query because it contains invalid data.'=>'Ошибка базы данных WordPress: Не удалось выполнить запрос, так как он содержит неверные данные.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'Стиль "%1$s" не может быть и