 are not allowed to filter users by capability.'=>'Извините, вам не разрешено отфильтровать пользователей по роли.','Unable to retrieve body from response at this URL.'=>'Невозможно получить текст ответа по данному URL.','URL not found. Response returned a non-200 status code for this URL.'=>'URL не найден. Сервер вернул для данного URL код состояния, отличный от 200.','Sorry, you are not allowed to process remote URLs.'=>'Вам не разрешено обрабатывать удалённые URL.','Invalid URL'=>'Неверный URL','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'Ссылка на изображение Open Graph для %1$s или %2$s элементов из URL.','The content of the %s element from the URL.'=>'Содержимое элемента %s из URL.','The favicon image link of the %s element from the URL.'=>'Ссылка на изображение значка сайта для элемента %s из URL.','The contents of the %s element from the URL.'=>'Содержимое элемента %s из URL.','The URL to process.'=>'URL для обработки.','Where the template part is intended for use (header, footer, etc.)'=>'Где предполагается использовать часть шаблона ( шапка, подвал и т.д.)','Whether a template is a custom template.'=>'Является ли шаблон пользовательским.','The ID for the author of the template.'=>'ID автора шаблона.','HTML title for the template, transformed for display.'=>'HTML-заголовок для шаблона, преобразованный для показа.','Title for the template, as it exists in the database.'=>'Заголовок шаблона в том виде, в котором он существует в базе данных.','Version of the content block format used by the template.'=>'Версия формата блоков содержимого, используемая шаблоном.','Content for the template, as it exists in the database.'=>'Содержимое шаблона, как он существует в базе данных.','Source of a customized template'=>'Источник персонализированного шаблона','Type of template.'=>'Тип шаблона.','Post type to get the templates for.'=>'Тип записи, для которого нужно получить шаблоны.','Limit to the specified template part area.'=>'Ограничение определённой области шаблона.','REST namespace route for the taxonomy.'=>'Маршрут пространства имен REST для таксономии.','Whether to make the post type available for selection in navigation menus.'=>'Доступность типа записи для выбора в меню навигации.','Whether to generate a default UI for managing this post type.'=>'Создать пользовательский интерфейс по умолчанию для управления этим типом записи.','The visibility settings for the post type.'=>'Настройки видимости типа записи.','REST route\'s namespace for the post type.'=>'Пространство имен маршрута REST для типа записи.','Whether to automatically add top level pages to this menu.'=>'Следует ли автоматически добавлять страницы верхнего уровня в это меню.','The locations assigned to the menu.'=>'Места, назначенные меню.','The menu cannot be deleted.'=>'Меню не может быть удалено.','Menus do not support trashing. Set \'%s\' to delete.'=>'Меню нельзя переместить в корзину. Установите \'%s\' для удаления.','Sorry, you are not allowed to view menus.'=>'Извините, вам не разрешено просматривать меню.','The ID of the assigned menu.'=>'Идентификатор назначенного меню.','The description of the menu location.'=>'Описание расположения меню.','The name of the menu location.'=>'Имя расположения меню.','Invalid menu location.'=>'Неверное расположение меню.','Sorry, you are not allowed to view menu locations.'=>'К сожалению, вы не можете просматривать расположение меню.','An alphanumeric identifier for the menu location.'=>'Буквенно-цифровой идентификатор расположения меню.','The terms assigned to the object in the %s taxonomy.'=>'Элементы назначенные объекту в таксономии %s.','Whether the menu item represents an object that no longer exists.'=>'Представляет ли элемент меню объект, который больше не существует.','The XFN relationship expressed in the link of this menu item.'=>'Отношение XFN, выраженное в ссылке этого пункта меню.','The URL to which this menu item points.'=>'URL-адрес, на который указывает этот пункт меню.','The singu