###SITEURL###','Only UUID V4 is supported at this time.'=>'В настоящее время поддерживаются только UUID V4.','The Press This plugin is required.'=>'Требуется плагин Press This.','%s themes'=>'%s тем','Filter themes (%s)'=>'Фильтр тем (%s)','Go to theme sources'=>'Перейти к источникам тем','Search WordPress.org themes'=>'Поиск тем на WordPress.org','Install &amp; Preview'=>'Установка и предпросмотр','Invalid URL.'=>'Неверный URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Время добавить пару ссылок! , Нажмите &#8220;%s&#8221;, чтобы начать добавлять страницы, рубрики и произвольные ссылки в меню, добавляйте столько, сколько вам нравится.','Choose image'=>'Выбор изображения','Choose audio'=>'Выберите аудио','Change audio'=>'Изменить аудио','Select audio'=>'Выбор аудио','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Нажмите &#8220;Добавить медиафайл&#8221; для загрузки файла изображения с компьютера. Ваша тема лучше всего смотрится с изображением заголовка высотой %s пикселей. После загрузки изображение можно обрезать, чтобы оно идеально поместилось.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Нажмите &#8220;Добавить медиафайл&#8221; для загрузки файла изображения с компьютера. Ваша тема лучше всего смотрится с изображением заголовка шириной %s пикселей. После загрузки изображение можно обрезать, чтобы оно идеально поместилось.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Нажмите &#8220;Добавить медиафайл&#8221; для загрузки файла изображения с компьютера. Ваша тема лучше всего смотрится с изображением заголовка размером %s пикселей. После загрузки изображение можно обрезать, чтобы оно идеально поместилось.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Нажмите &#8220;Добавить медиафайл&#8221; для загрузки файла изображения с вашего компьютера. Ваша тема лучше всего смотрится с изображением соответствующим размеру видео. &#8212; Вы сможете обрезать изображение после загрузки, чтобы оно идеально поместилось.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Меридиан','Minute'=>'Минута','Hour'=>'Час','Time'=>'Время','Day'=>'День','Month'=>'Месяц','Date'=>'Дата','Usage of user levels is deprecated. Use capabilities instead.'=>'Использование уровней для пользователей устарело. Используйте возможности.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тема определяет себя как родительскую для себя же. Пожалуйста, проверьте заголовок %s.','Name for the Visual editor tabVisual'=>'Визуально','Create New Menu'=>'Создать новое меню','New Menu'=>'Новое меню','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Если используемая тема имеет области виджетов, то вы можете также добавить туда меню. Зайдите на <a href="%s">панель управления виджетами</a> и добавьте &#8220;Виджет меню навигации&#8221;, чтобы отображать меню на боковой панели или в подвале.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Если ваша тема поддерживает множественные меню, ясные названия помогут вам с управлением ими.','Your theme can display menus in %s location.'=>'Ваша тема может показывать меню в %s месте.' . "\0" . 'Ваша тема может показывать меню в %s местах.' . "\0" . 'Ваша тема может показывать меню в %s местах.','Your theme can display menus in one location.'=>'Ваша тема может показывать меню в одном месте.','CSS code'=>'код CSS','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Поле редактирования автоматически подсвечивает синтаксис кода. Вы можете отключить это у себя в <a href="%1$s" %2$s>профиле пользователя%3$s</a> и работать как с обычным текстом.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'При использовании программы чтения с экрана: в режиме форм вам потребуется нажать кнопку Esc дважды.','To move away from this area, press the Esc key followed by the Tab key.'=>'Чтобы покинуть эту область, нажмие Esc и следом Tab.','In the editing area, the Tab key enters a tab character.'=>'В области редактирования кнопка Tab вставляет символ табуляции.','When using a keyboard to navigate:'=>'При использовании клавиатуры для навигации:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Добавьте собственный CSS код для настройки внешнего вида и макета вашего сайта.','Your homepage displays'=>'На главной странице отображать','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Вы можете выбрать то, что отображается на главной странице вашего сайта. Это могут быть записи в обратном хронологическом порядке (классический блог) или постоянная/статическая страница. Чтобы установить статическую главную страницу, вам нужно создать две страницы. Одна станет главной страницей, на второй будут показываться ваши записи.','Homepage Settings'=>'Настройки главной страницы','WordPress.org themes'=>'Темы WordPress.org','Installed themes'=>'Установленные темы','Publish Settings'=>'Настройки публикации','Copied'=>'Скопировано','Preview Link'=>'Ссылка на предпросмотр','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Посмотрите как изменения будут вживую смотреться на вашем сайте и поделитесь предпросмотром с теми, у кого нет доступа к настройкам.','Share Preview Link'=>'Поделиться ссылкой на предпросмотр','Changes trashed successfully.'=>'Изменения удалены в корзину.','Changes have already been trashed.'=>'Изменения уже были удалены в корзину.','Unable to trash changes.'=>'Не удалось удалить изменения в корзину.','No changes saved yet, so there is nothing to trash.'=>'Никаких изменений не было сохранено, поэтому нечего удалять.','There was an authentication problem. Please reload and try again.'=>'Возникла проблема с авторизацией. Пожалуйста, перезагрузите и попробуйте снова.','Unable to save due to %s invalid setting.'=>'Не удалось сохранить из-за %s неверной настройки.' . "\0" . 'Не удалось сохранить из-за %s неверных настроек.' . "\0" . 'Не удалось сохранить из-за %s неверных настроек.','You must supply a future date to schedule.'=>'Вы должны указать дату в будущем для планирования.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Предыдущий набор изменений уже был опубликован. Пожалуйста, попробуйте снова сохранить ваш текущий набор изменений.','Edit User'=>'Редактировать пользователя','View User'=>'Просмотр пользователя','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Этот виджет мог содержать код, который возможно будет работать лучше с новым виджетом &#8220;HTML-код&#8221; Как насчет того, чтобы попробовать его ?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Эй! Выглядит так, как будто вы только что вставили HTML в визуальный редактор виджета Текст. Наверное лучше было вставить его в вкладку &#8220;Текст&#8221; Альтернативно, попробуйте новый виджет &#8220;Пользовательского HTML&#8221;!','Did you just paste HTML?'=>'Вы только что вставили HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Эй! А вы знаете что у нас теперь есть виджет &#8220;HTML-код&#8221; ? Вы можете найти его в списке доступных виджетов на этом экране. Попробуйте его для вставки пользовательского кода на ваш сайт!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Эй! А вы знаете что у нас теперь есть виджет &#8220;HTML-код&#8221; ? Вы можете найти его нажав кнопку &#8220;<a class="add-widget" href="#">Добавить виджет</a>&#8221; и поискав &#8220;HTML&#8221;. Попробуйте его для вставки пользовательского кода на ваш сайт!','New Custom HTML Widget'=>'Новый виджет пользовательского HTML','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Этот виджет содержит код, более подходящий для нового виджета &#8220;HTML-код&#8221;. Как насчет того, чтобы попробовать его?','Arbitrary text.'=>'Произвольный текст.','Some HTML tags are not permitted, including:'=>'Некоторые HTML теги недопустимы, включая:','Custom HTML'=>'HTML-код','Arbitrary HTML code.'=>'Пр